import './App.css';
import './pages/Home';
import './pages/MemberInfo';
import './pages/ModifyInfo';

function App() {
  return (
    <div className="App">
      <header>
        <div className='member-photo'><img src={Photo} alt="photo" /></div>
        <div className="member-name"><h1>李姍姍</h1><p>上線中</p></div>
      </header>
      <main>
        <div className='announcement'>
          <h2>Home心公告</h2>
          <hr />
          <ul>
            <li>疫情期間，大家要多注意勤洗手，小心健康！</li>
            <li>若您已經施打完疫苗，可以透過小幫手回報給我們唷！</li>
          </ul>
        </div>
        <div className="feature">
          <div className="info"></div>
          <div className="query"></div>
          <div className="service"></div>

        </div>

      </main>
      {/* <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>Edit <code>src/App.js</code> and save to reload.</p>
        <a className="App-link" href="https://reactjs.org" target="_blank" rel="noopener noreferrer">Learn React</a>
      </header> */}
    </div>
  );
}

export default App;
